import './App.css';
import Header from './my_components/Header';
import Storyform from './my_components/Storyform';
import Storyform2 from './my_components/Storyform2';

function App() {
  return (
    <>
    {/* <Header/> */}
    {/* <Storyform/>
    <Storyform2/> */}
    <div className="wrapper">
      <h1>How About Them Apples</h1>
      <form>
      <fieldset>
         <label>
           <p>Name</p>
           <input name="name" />
         </label>
       </fieldset>
       <button type="submit">Submit</button>
      </form>
    </div>
    </>
  );
}

export default App;
